  input: '"TEXT","F3XA","C00143743","Upon further review of the data previously reported
    and as a result of the changes to the April, May, June, July and August Reports
    amended on March 26, 2007 we identified a decrease in contributions in the amount
    of $20.  We reviewed and reclassified $2,143.35 as allocated expenditures.  With
    the year to date changes reported on these amended reports, the net change in
    cash available is a decrease of $1,384.    Allocated activity reported on H4 year
    to date totals are correct on lines 21ai and 21aii.    As a result of software
    upgrade on March 5, 2007, we are no longer able to sort our data based on date
    of expenditure.   The software program however, reflects a date total on each
    record.  Consequently, each record shows a  year to date total for the type of
    activity based on date, but the random reporting by name of the expenditures,
    makes the year to date totals appear incorrect.  After careful reconciliation
    of each activity, the totals reflected on lines 21ai and 21aii are correct for
    the allocated expenditures.  All transfers which were not made within the 70 day
    time period have been returned to the non-federal account as previously reported.  Respectfully
    submitted, Wayne Tucker, Treasurer"'
